webpackJsonp([4169192826041],{420:function(e,t){e.exports={data:{markdownRemark:{html:'<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.54888103651355%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="poster"\n        title=""\n        src="/static/tns-platform-specific-poster-5b1127896cad1f02d0ab92f5fffd5363-83a8b.png"\n        srcset="/static/tns-platform-specific-poster-5b1127896cad1f02d0ab92f5fffd5363-8992e.png 163w,\n/static/tns-platform-specific-poster-5b1127896cad1f02d0ab92f5fffd5363-ae0a7.png 325w,\n/static/tns-platform-specific-poster-5b1127896cad1f02d0ab92f5fffd5363-83a8b.png 650w,\n/static/tns-platform-specific-poster-5b1127896cad1f02d0ab92f5fffd5363-6ee50.png 849w"\n        sizes="(max-width: 650px) 100vw, 650px"\n      />\n    </span>\n  </span>\n  \n\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 300px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 100%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="poster"\n        title=""\n        src="/static/alex_ziskind-defebeeb098117944e669ca131d290c3-7358a.png"\n        srcset="/static/alex_ziskind-defebeeb098117944e669ca131d290c3-c52a9.png 163w,\n/static/alex_ziskind-defebeeb098117944e669ca131d290c3-7358a.png 300w"\n        sizes="(max-width: 300px) 100vw, 300px"\n      />\n    </span>\n  </span>\n  </p>\n<p>Have you ever written platform specific code in NativeScript, whether it was JavaScript or CSS?\nDid it look like a giant <code>if</code>-<code>then</code>-<code>else</code> statement? Or maybe you even separated out your platform specific code into separate functions, but you still needed conditional statements and your code for iOS and Android still gets packaged up whether it’s destined for one platform or another. In this series of videos, I’ll show you how to avoid doing this altogether and get only the code you need for a specific platform packaged, all while using clean interfaces and TypeScript.\n<br/><br/></p>\n<div class="well">\n<h6>Tip #1 - Classes</h6>\n<p>\nIn this first video of the series, I show you how to separate out your platform specific code using TypeScript classes. If you need to execute different code paths on iOS and Android, and you need to encapsulate your logic using a class, this video shows you how to do it.\n<br/><br/>\n</p>\n<div class="videoWrapper">\n    <iframe width="560" height="315" src="https://www.youtube.com/embed/btq7D7w81C0" frameborder="0" allowfullscreen></iframe>\n</div>\n</div>\n<div class="well">\n<h6>Tip #2 - Functions</h6>\n<p>\nIn this second video of the series, I show you how to execute different code while calling a single function. If you need to execute different code on iOS and Android, but you’re using a functional approach, or you have some utility function, and don’t need to create a class, then this video shows you how.\n<br/><br/>\n</p>\n<div class="videoWrapper">\n    <iframe width="560" height="315" src="https://www.youtube.com/embed/rNe4UJD216A" frameborder="0" allowfullscreen></iframe>\n</div>\n</div>\n<div class="well">\n<h6>Tip #3 - CSS</h6>\n<p>\nIn this third video of the series, I show you how the best way I found so far to separate out your platform specific CSS code, while still allowing for code reuse of the styles that are shared between platforms.\n<br/><br/>\n</p>\n<div class="videoWrapper">\n    <iframe width="560" height="315" src="https://www.youtube.com/embed/v5g6irUI704" frameborder="0" allowfullscreen></iframe>\n</div>\n</div>\n<p>I hope you enjoy the series, and let me know (<a href="https://twitter.com/digitalix" target="_blank">@digitalix</a> on Twitter) if you have a specific need for code separation or you want to see a video of a different case that’s not covered in this series yet.</p>',frontmatter:{title:"Getting Platform Specific in NativeScript",path:"/posts/getting-platform-specific-in-nativescript"}}},pathContext:{slug:"/posts/getting-platform-specific-in-nativescript"}}}});
